def overwrite_mtd(offset_of_mtd: int, main_code: bytes, code: bytes, is_tiny_header: bool = False) -> list[bytes]:
    if is_tiny_header:
        code_size = main_code[offset_of_mtd] >> 2
        start_of_code_offset = offset_of_mtd + 1
    else:
        code_size = int.from_bytes(main_code[offset_of_mtd+4:offset_of_mtd+8], byteorder='little')
        start_of_code_offset = offset_of_mtd + 12

    if code_size != len(code):
        print("Method's space doesn't match. Incorrect header or method?")
        # printing stack trace
        traceback.print_stack()
        return

    main_code = main_code[:start_of_code_offset] + code + main_code[start_of_code_offset+code_size:]

    return main_code

def format_code_flare71(m: dict, b: list[int]) -> bytes:
    ''' To overwrite position with metadata tokens'''
    for index, metadata_token in m.items():
        token_bytes = metadata_token.to_bytes(4, 'little')
        #Store the metadata token in little-endian. Have to splited them into bytes and add one by one since our code of bytes is currently in a list
        for i, val_byte in enumerate(token_bytes):
            b[index+i] = val_byte

    return bytes(b)
    
def flare_68(b: list[int], o: int) -> int:
    num = b[o + 3] * 16777216
    num += b[o + 2] * 65536
    num += b[o + 1] * 256
    return num + b[o]


def format_code_flared67(m: dict, b: list) -> bytes:
    '''Needs to follow FLARE15.flared67()'s algorithm to get each deobfuscated metadata token.'''
    j = 0
    while j < len(b):
        if b[j] == 254:
            key = 65024 + b[j + 1]
            j += 1
        else:
            key = b[j];
        
        ot = dictionary[key]
        j += 1

        if ot == 1:
            num = flare_68(b, j)
            num ^= 2727913149
            # num == Metadata token
            token_bytes = num.to_bytes(4, 'little')
            #Store the metadata token in little-endian. Have to splited them into bytes and add one by one since our code of bytes is currently in a list
            for i, val_byte in enumerate(token_bytes):
                b[j+i] = val_byte
            j += 4
        elif ot == 2 or ot == 4:
            j += 1
        elif ot == 3 or ot == 6:
            j += 4
        elif ot == 5:
            j += 2
        elif ot == 7:
            j += 8
        elif ot == 8:
            j += 4 + flare_68(b, j) * 4

    return bytes(b)


